import { Component, Input, OnInit } from '@angular/core';
import { FormGroup, FormControl } from '@angular/forms';


@Component({
  selector: 'app-clancard',
  templateUrl: './clancard.component.html',
  styleUrls: ['./clancard.component.css']
})
export class ClancardComponent implements OnInit {
  @Input() clan: any;

  editClanForm: FormGroup | any;

  name: string = "";
  id: number = 0;
  desc: string = "";

  constructor(private auth: ) { }

  ngOnInit() {
    this.editClanForm = new FormGroup({
      name: new FormControl(),
      desc: new FormControl(),
    });
    this.name = this.clan.name;
    this.id = this.clan.id;
    this.desc = this.clan.desc;
  }

  onSave() {

  }

  onDelete() {
    console.log("delete");
  }

}
